import ptz from "./ptz.svg";
import "./App.css";

export function App() {
	return (
		<div className="App">
			<header className="App-header">
				<img src={ptz} className="App-logo" alt="PUTZ Logo" />
			</header>
			{LinkInput()}
		</div>
	);
}

// Define text input for links
function LinkInput() {
	return (
		<input
			className="urlInput"
			name="SoundCloud URL Input"
			placeholder="Enter SoundCloud URL..."
		/>
	);
}

export default App;
